          if (/[A-Za-z]/.test(this.addressInfo.phone)) {
            this.$util.showToast("联系电话格式不正确");
            return false;
          } else if (/[\u4e00-\u9fa5]/.test(this.addressInfo.phone)) {
            this.$util.showToast("联系电话格式不正确");
            return false;
          }
